function Payment(){
    return (
        <div>
            <h4>Payment methods</h4>
            <div className='row'>
               <img src="../images/paypal.png" alt="img"/>
               <img src="../images/visa.png" alt="img" />
               <img src="../images/mastercard.png" alt="img" />
            </div>
            <div className='row'>

            </div>
        </div>
    );
}

export default Payment;
